 network plot.jpeg](attachment:620a86c1-6ee1-49fe-8cf3-a9e347093a60.jpeg)"]},{"cell_type":"markdown","id":"27c6c873","metadata":{"papermill":{"duration":0.113185,"end_time":"2022-01-24T20:46:48.833839","exception":false,"start_time":"2022-01-24T20:46:48.720654","status":"completed"},"tags":[]},"source":["**The model is reporting a sum of squarred error as 5.666584 with 713 steps taken. The lower the SSE, the better the predictive performance.**"]},{"cell_type":"markdown","id":"018adce6","metadata":{"papermill":{"duration":0.113604,"end_time":"2022-01-24T20:46:49.062125","exception":false,"start_time":"2022-01-24T20:46:48.948521","status":"completed"},"tags":[]},"source":["## MODEL PERFORMANCE EVALUATION"]},{"cell_type":"markdown","id":"ba7f51de","metadata":{"papermill":{"duration":0.112386,"end_time":"2022-01-24T20:46:49.288218","exception":false,"start_time":"2022-01-24T20:46:49.175832","status":"completed"},"tags":[]},"source":["**To generate predictions on the test dataset, i will use the compute() function which is a bit different from the predict() function we usually use for other algorithms. The compute function returns two components; $neurons, which stores the neurons from each layer in the network, and $net.result, which stores the predicted values. I am interested in the predicted values** "]},{"cell_type":"code","execution_count":13,"id":"0089cae2","metadata":{"execution":{"iopub.execute_input":"2022-01-24T20:46:49.520566Z","iopub.status.busy":"2022-01-24T20:46:49.518476Z","iopub.status.idle":"2022-01-24T20:46:49.533459Z","shell.execute_reply":"2022-01-24T20:46:49.531698Z"},"papermill":{"duration":0.132611,"end_time":"2022-01-24T20:46:49.533623","exception":false,"start_time":"2022-01-24T20:46:49.401012","status":"completed"},"tags":[]},"outputs":[],"source":["model_results <- compute(concrete_model, concrete_test[1:8])"]},{"cell_type":"code","execution_count":14,"id":"0eb7ea0f","metadata":{"execution":{"iopub.execute_input":"2022-01-24T20:46:49.764969Z"